import './Home.css';
import Header from '../../components/header/Header'

function Home() {
    return (
        <main className="App">
            < Header />
            <header className="App-header">
                <p>
                    Edit <code>src/App.js</code> and save to reload.
                </p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Learn React
                </a>
            </header>
        </main>
    );
}

export default Home;
